			["customText"] = "\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["untrigger"] = {
			},
			["activeTriggerMode"] = -10,
			["sparkRotationMode"] = "AUTO",
			["displayTextLeft"] = "%Ticks",
			["animation"] = {
				["start"] = {
					["type"] = "none",
					["duration_type"] = "seconds",
				},
				["main"] = {
					["y"] = 0,
					["type"] = "custom",
					["colorR"] = 1,
					["duration_type"] = "seconds",
					["x"] = 0,
					["scaley"] = 1,
					["alpha"] = 0,
					["scalex"] = 1,
					["alphaType"] = "custom",
					["colorA"] = 1,
					["colorG"] = 1,
					["alphaFunc"] = "function(progress, start, delta)\n    if aura_env \n    and aura_env.state \n    and aura_env.state.expirationTime\n    then\n        local bar = WeakAuras.regions[aura_env.id].region.bar\n        local region = WeakAuras.regions[aura_env.id].region\n        local fgWidth = bar.fg:GetWidth()\n        region.text:SetPoint(\"BOTTOMLEFT\", region, \"BOTTOMLEFT\", 0,3)\n        region.timer:SetPoint(\"BOTTOMRIGHT\", region, \"BOTTOMRIGHT\", 0,3)\n        \n        --Collect all required info\n        --get LnL stacks\n        local stacks = 0\n        if UnitBuff(\"player\", GetSpellInfo(194595))   then\n            stacks = select(4, UnitBuff(\"player\", GetSpellInfo(194595)) )\n        end\n        local currentStacks = stacks > 0 and \" + \"..stacks or \"\" -- save stack count for addition to text output later\n        -- get Precisioin (tier proc)\n        local precision = UnitBuff(\"player\", GetSpellInfo(246153)) and true or false\n        --get GCD length (thanks to @Rivers)\n        local gcd = UnitPowerType'player' == 3 \n        and (UnitBuff(\"player\",GetSpellInfo(13750)) \n        and .8 or 1) or max(1.5/(1 + .01 * UnitSpellHaste'player'), \n            UnitBuff('player', GetSpellInfo(194249)) and .67 or .75)\n        --get latency\n        local latTime = select(4, GetNetStats())/1000 or 0\n        -- get Aimed shot cast time (current and regular (for LnL procs))\n        local AiSDirect = select(4, GetSpellInfo(19434))/1000\n        local AiSCalc = 2 / (( GetHaste() / 100 ) + 1)\n        AiSCalc = aura_env.set and AiSCalc*0.82 or AiSCalc\n        local AiSmax = stacks == 0 and AiSDirect or AiSCalc\n        -- get remaining timer\n        local remaining = aura_env.state.expirationTime - GetTime()\n        -- get pixels per second\n        local pix = region.bar:GetWidth() / aura_env.state.duration\n        -- pixel width of foreground\n        local maxPix = pix * remaining\n        -- get current cast and gcd info\n        local castName,_,_,_,_,castEnd = UnitCastingInfo(\"player\")\n        local castEnd = castEnd and castEnd / 1000 or 0\n        local currentCast = castEnd > 0 and castEnd - GetTime() or 0\n        local currentGCD = WeakAuras.gcdDuration() > 0 and select(2, WeakAuras.GetGCDInfo()) - GetTime() or 0\n        local current = math.max(currentCast, currentGCD)\n        \n        -- Create runningTotal. \n        -- This will collect all the offsets of potential ticks which we can compare against the bar width\n        local runningTotal = 0\n        \n        --region.tickPool:ReleaseAll(); -- release all textures before animation/creation\n        \n        --add the \"cast bar\" indicator\n        if current > 0 then -- if we're casting/on GCD\n            local offset = pix * (current + latTime) -- calc offset\n            runningTotal = runningTotal + offset\n            -- don't let it overrun the size of the bar\n            if offset <= fgWidth then \n                bar.cast:SetWidth(offset);\n            else\n                bar.cast:SetWidth(fgWidth);\n            end\n            -- if cast ends after Vuln\n            if castEnd > aura_env.state.expirationTime then \n                bar.cast:SetVertexColor(1,0,0,1)\n            else\n                bar.cast:SetVertexColor(aura_env.castR,aura_env.castG,aura_env.castB,aura_env.castA)\n            end\n            bar.cast:SetHeight(math.max(3,bar:GetHeight()/2));\n            bar.cast:ClearAllPoints()\n            bar.cast:SetPoint(\"TOPRIGHT\", bar.fg, \"TOPRIGHT\", 0, 0)\n            bar.cast:Show()\n        end\n        \n        \n        local Ticks = 0 -- set up the count for display later\n        local castHandled = false -- create a flag for handling the current cast, tick or not\n        local i = 1\n        while runningTotal <= maxPix do\n            -- iterate through\n            local IsGCD = false -- create a flag to set GCD colouring\n            if not castHandled and castName and castName == GetSpellInfo(19434) then\n                castHandled = true -- if current cast is AiS then add a tick mark at the end of the cast\n            elseif stacks > 0 then -- handle LnL procs\n                stacks = stacks - 1\n                local offset = pix * (gcd + latTime)\n                runningTotal = runningTotal + offset\n                IsGCD = true\n            else -- else predict future AiS casts\n                local offset = pix * (AiSmax + latTime)\n                runningTotal = runningTotal + offset\n            end\n            if runningTotal < maxPix then -- if we're still within the area then make the tick \n                if IsGCD then\n                    bar.tickTable[i]:SetColorTexture(\n                        aura_env.GCDtickR,\n                        aura_env.GCDtickG,\n                        aura_env.GCDtickB,\n                        aura_env.GCDtickA\n                    )\n                else \n                    bar.tickTable[i]:SetColorTexture(\n                        aura_env.tickR,\n                        aura_env.tickG,\n                        aura_env.tickB,\n                        aura_env.tickA\n                    )\n                end\n                bar.tickTable[i]:SetWidth(aura_env.tickWidth);\n                bar.tickTable[i]:SetHeight(bar:GetHeight()+aura_env.tickHeight);\n                bar.tickTable[i]:ClearAllPoints()\n                bar.tickTable[i]:SetPoint(\"RIGHT\", bar.fg, \"RIGHT\", 0-runningTotal, 0)\n                bar.tickTable[i]:Show()\n                Ticks = Ticks + 1\n            else\n                if bar.tickTable[i] then bar.tickTable[i]:Hide() end\n            end\n            i = i+1\n        end\n        for j,v in ipairs(bar.tickTable) do\n            if j >= i then v:Hide() end \n        end\n        \n        bar.lastSec:SetPoint(\"LEFT\", bar, \"LEFT\", 0,0)\n        bar.lastSec:SetWidth(region.bar:GetWidth()/7)\n        bar.lastSec:Show()\n        \n        if aura_env.state then\n            aura_env.state.Ticks = Ticks\n            if Ticks > 0 then -- if count is 0 then colour red.\n                region.text:SetTextColor(1,1,1,1)\n            else\n                region.text:SetTextColor(1,0,0,1)\n            end\n            -- set text output for %Ticks\n            aura_env.state.Ticks = aura_env.state.Ticks .. currentStacks\n        end\n    end\n    return start\nend",
