				["init"] = {
					["custom"] = "--------------------------------\n--         SETTINGS           --  Made by asakawa\n--------------------------------\n\n-- Tick Width (pixels)\naura_env.tickWidth = 0\n\n-- Tick Height (relative to bar height, in pixels)\n-- (0 makes it the same height as the bar. 2 makes it larger. -2 smaller, etc.)\naura_env.tickHeight = 0\n\n-- Regular Tick colour (r , g, b, a) \naura_env.tickR = 0\naura_env.tickG = 0\naura_env.tickB = 0\naura_env.tickA = 0\n\n-- GCD (LnL) Tick colour (r , g, b, a) \naura_env.GCDtickR = 0\naura_env.GCDtickG = 0\naura_env.GCDtickB = 0\naura_env.GCDtickA = 0\n\n-- Cast bar colour (r , g, b, a) \naura_env.castR = 0\naura_env.castG = 0\naura_env.castB = 0\naura_env.castA = 0\n\n-- Last second colour (r , g, b, a) \naura_env.lsR = 0\naura_env.lsG = 0\naura_env.lsB = 0\naura_env.lsA = 0\n\n--------------------------------\n--     Don't edit below       --\n--------------------------------\n\nlocal region = WeakAuras.regions[aura_env.id].region\n\nlocal tickfactory = {\n    __index = function(t,k)\n        local tick = region.bar:CreateTexture(nil, 'OVERLAY')\n        t[k] = tick\n        --tick:SetColorTexture(1,1,1,1)\n        tick:SetColorTexture(aura_env.tickR,aura_env.tickG,aura_env.tickB,aura_env.tickA)\n        tick:SetBlendMode('BLEND')\n        tick:SetWidth(aura_env.tickWidth)\n        tick:SetHeight(region.bar:GetHeight()+aura_env.tickHeight)\n        return tick\n    end\n}\n\nregion.bar.tickTable = region.bar.tickTable or setmetatable({}, tickfactory)\nfor i,v in ipairs(region.bar.tickTable) do\n    v:Hide()\nend\n\nif not region.bar.cast then\n    region.bar.cast = region.bar:CreateTexture(nil, 'OVERLAY')\n    region.bar.cast:SetDrawLayer(\"ARTWORK\", 3);\n    region.bar.cast:SetColorTexture(aura_env.castR,aura_env.castG,aura_env.castB,aura_env.castA)\n    region.bar.cast:SetBlendMode('BLEND')\n    region.bar.cast:SetHeight(region.bar:GetHeight())\nend\n\nif not region.bar.lastSec then\n    region.bar.lastSec = region.bar:CreateTexture(nil, 'OVERLAY')\nend\nregion.bar.lastSec:SetDrawLayer(\"ARTWORK\", 3)\nregion.bar.lastSec:SetColorTexture(aura_env.lsR,aura_env.lsG,aura_env.lsB,aura_env.lsA)\nregion.bar.lastSec:SetBlendMode('BLEND')\nregion.bar.lastSec:SetHeight(region.bar:GetHeight())\n\nWeakAuras.WatchGCD()\nlocal aura_env = aura_env\n\n--Item Set\naura_env.set = false\nlocal Has4pc = function()\n    local setID = 1304\n    local itemList = C_LootJournal.GetItemSetItems(setID)\n    if not itemList then return end\n    local setName = GetItemSetInfo(setID)\n    local max = #itemList\n    local equipped = 0\n    for _,v in ipairs(itemList) do\n        if IsEquippedItem(v.itemID) then\n            equipped = equipped + 1\n        end\n    end\n    aura_env.set = equipped >=4\nend\nif not region.setChecker then\n    local setChecker = CreateFrame(\"Frame\")\n    region.setChecker = setChecker\nend\nregion.setChecker:RegisterEvent(\"PLAYER_EQUIPMENT_CHANGED\")\nregion.setChecker:SetScript(\"OnEvent\", Has4pc)\nHas4pc()",
