					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    \n    local red, green, blue = 1,1,1\n    local _,gcd = GetSpellCooldown(61304)\n    \n    local t1d,t1d = GetSpellCooldown(108238)\n    local t2s,t2d = GetSpellCooldown(102280)\n    local t3s,t3d = GetSpellCooldown(102401)\n    \n    local RL = select(4, GetTalentInfo(2, 1, 1))\n    local DB = select(4, GetTalentInfo(2, 2, 1))\n    local WC = select(4, GetTalentInfo(2, 3, 1))\n    \n    if RL then\n        \n        \n        if  t1d ~=0 and t1d > gcd then\n            \n            red, green, blue = 0.45,0.45,0.45\n            \n        else\n            \n            red, green, blue = 1,1,1\n            \n        end\n    end\n    \n    if DB then\n        \n        \n        if  t2d ~=0 and t2d > gcd then\n            \n            red, green, blue = 0.45,0.45,0.45\n            \n        else\n            \n            red, green, blue = 1,1,1\n            \n        end\n    end\n    \n    if WC then\n        \n        \n        if  t3d ~=0 and t3d > gcd then\n            \n            red, green, blue = 0.45,0.45,0.45\n            \n        else\n            \n            red, green, blue = 1,1,1\n            \n        end\n    end\n    \n    \n    return red, green, blue, 1\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
