					["type"] = "custom",
					["translateType"] = "straightTranslate",
					["scaley"] = 1,
					["translateFunc"] = "function(progress, startX, startY, deltaX, deltaY)\n      return startX + (progress * deltaX), startY + (progress * deltaY)\n    end\n  ",
