				["customDuration"] = "function()\n    local max = UnitPowerMax(\"player\")\n    local current = UnitPower(\"player\")\n    \n    return current + WeakAuras.MOONFUZZ_ANTONIDAS_EU.DH.PainGain,\n    max, true\nend\n\n\n\n\n\n",
