				["custom"] = "function(e,...)\n    --OPTIONS IN ACTIONS>ONINIT\n    --OPTIONS IN ACTIONS>ONINIT\n    aura_env.lastTick=aura_env.lastTick or aura_env.TMtimer-120\n    if select(4,GetTalentInfo(1,3,1)) and aura_env.addTM then --TM selected\n        if select(12,...)==210643 and select(5,...)==UnitName(\"player\") and select(2,...)==\"SPELL_CAST_SUCCESS\" then --TM casted by player\n            aura_env.TMtimer=GetTime()+120 --Get TM end\n        elseif select(2,...)==\"SPELL_PERIODIC_ENERGIZE\" and select(5,...)==GetSpellInfo(202192) and select(9,...)==UnitName(\"player\") then\n            aura_env.lastTick=GetTime()\n        end\n    end\n    aura_env.this = WeakAuras.regions[aura_env.id].region\n    local width = aura_env.this.bar:GetWidth()\n    local tick = aura_env.TMtickToCastEnd()\n    local curMs = UnitPower('player',11)\n    local maxMs = UnitPowerMax('player',11)\n    local curMn = UnitPower('player', 0)\n    local maxMn = UnitPowerMax('player', 0)\n    aura_env.baseBar:SetValue(curMs/maxMs)\n    aura_env.predictBar:SetValue(aura_env.predictMs()/maxMs)\n    aura_env.manaBar:SetValue(curMn/maxMn)\n    for k,v in pairs(aura_env.showMarkers) do\n        if v then\n            aura_env.moveMarker(k,k)\n        end\n        if k==86 then\n            aura_env.moveMarker(86,(aura_env.getESvalue()+maxMs-100))\n        end          \n    end \n    aura_env.updateMarker()\n    aura_env.updateColorBaseBar()\n    aura_env.updateColorPredictBar()\n    if aura_env.showMana then\n        aura_env.updateColorManaBar()\n    end\n    if aura_env.showCastBar==\"rectangle\" or aura_env.showCastBar==\"spark\" then\n        aura_env.updateCastBar()\n    end\n    if type(tonumber(aura_env.capSoundValue))==\"number\" or aura_env.capSoundValue==\"ES\" then\n        aura_env.playSound()\n    end\n    return true \nend",
