				["init"] = {
					["custom"] = "--OPTIONS\n--RELOAD AFTER CHANGING THEM\naura_env.showMana=true\naura_env.showPrediction=true\naura_env.addTM=true\naura_env.EStype=\"dynamic\" --Enter \"dynamic\" or \"static\" (86Ms)\naura_env.showMarkers={}\naura_env.markerCond=function()\n    aura_env.showMarkers[20]=true\n    aura_env.showMarkers[40]=(select(4,GetTalentInfo(7,3,1)) and true) or false\n    aura_env.showMarkers[50]=not(aura_env.showMarkers[40])\n    aura_env.showMarkers[60]=aura_env.showMarkers[40]\n    aura_env.showMarkers[80]=aura_env.showMarkers[40]\n    aura_env.showMarkers[100]=aura_env.showMarkers[40]\n    aura_env.showMarkers[86]=not(aura_env.showMarkers[40])\nend\n\naura_env.capSoundValue=\"no\" --Enter a value between 0 and 100, \"ES\" or \"no\"\naura_env.capSoundPath=\"Interface/AddOns/WeakAuras/PowerAurasMedia/Sounds/thunder.ogg\"\n--Changes Textures after a certain Ms value \naura_env.barAtCap=\"no\" --Enter a value between 0 and 100, \"ES\" or \"no\"\naura_env.barAtCapBaseT=\"SPELLS/LIGHTNING_AREA_DISC_STATE.m2\"\naura_env.barAtCapPredT=\"SPELLS/LIGHTNING_AREA_DISC_STATE.m2\"\n\n--CASTBAR\n--    FORMAT : \n--    \"none\"      = Do not display Cast Bar\n--    \"rectangle\" = Show a rectangle around the Main Bars\n--    \"spark\"     = Show a spark moving through the prediction bar\naura_env.showCastBar=\"spark\"\n\n--CASTBAR OPTIONS\n\naura_env.castBarThickness=7 --Rectangle Thickness\naura_env.castBarRectT=\"Interface/TARGETINGFRAME/UI-StatusBar\" --Rectangle Texture\naura_env.castBarRectC={r=0.4,g=0.4,b=0.4,a=1} --Rectangle Color\n\naura_env.castBarSparkWidth=12 -- Spark Width\naura_env.castBarSparkT=\"Interface/CastingBar/UI-CastingBar-Spark\" --Spark Texture\naura_env.castBarSparkC={r=1,g=1,b=1,a=1} --Spark Color\n\n--------------------------------------------------------------------\n\n--TEXTURES\naura_env.markerT=\"Interface/AddOns/WeakAuras/Media/Textures/Square_Smooth_Border2\"\naura_env.baseBarT=\"Interface/RaidFrame/Raid-Bar-Hp-Fill\"\naura_env.predictBarT=\"Interface/RaidFrame/Raid-Bar-Hp-Fill\"\naura_env.manaBarT=\"Interface/RaidFrame/Raid-Bar-Hp-Fill\"\naura_env.bgBarT=\"Interface/RaidFrame/Raid-Bar-Hp-Fill\"\n\n--------------------------------------------------------------------\n\n--BASE COLORS\n--    FORMAT : Red, Green, Blue, Alpha\naura_env.baseBarC={r=0,g=0.44,b=1,a=1}\naura_env.predictBarC={r=0,g=0.93,b=1,a=1}\naura_env.bgBarC={r=0,g=0,b=0,a=0.52}\naura_env.manaBarC={r=0.03,g=0,b=0.84,a=1}\naura_env.markerC={r=1,g=1,b=1,a=1}\n\n--------------------------------------------------------------------\n\n--CHANGING COLOR\naura_env.type=\"false\" --ENTER \"steps\" or \"linear\" or \"false\"!\n--  Base Bar Colors\naura_env.baseBarCC={}\n--    steps \n--    FORMAT : true/false, Red, Green, Blue, Alpha\naura_env.baseBarCC[0]={s=true,r=0,g=0.44,b=1,a=1}\naura_env.baseBarCC[20]={s=false,r=0.10,g=0.15,b=0.90,a=1} --FlS\naura_env.baseBarCC[50]={s=true,r=1,g=0.37,b=0,a=1} --EQT\naura_env.baseBarCC[86]={s=true,r=1,g=0,b=0.08,a=1} --ES\n--    linear\n--    FORMAT : Red, Green, Blue, Alpha\naura_env.baseBarCC[\"start\"]={r=1,g=1,b=0,a=1}\naura_env.baseBarCC[\"end\"]={r=1,g=0,b=0,a=1}\n\n--  Predict Bar Colors\naura_env.predictBarCC={}\n--    steps \n--    FORMAT : true/false, Red, Green, Blue, Alpha\naura_env.predictBarCC[0]={s=true,r=0,g=0.93,b=1,a=1}\naura_env.predictBarCC[20]={s=false,r=0.65,g=0.70,b=0.85,a=1} --FlS\naura_env.predictBarCC[50]={s=true,r=0.95,g=0.67,b=0.30,a=1} --EQT\naura_env.predictBarCC[86]={s=true,r=0.95,g=0.35,b=0.45,a=1} --ES\n\n--  Mana Bar Colors\naura_env.manaBarCC={}\n--    steps \n--    As the number of Healing Surge you can cast\n--    FORMAT : true/false, Red, Green, Blue, Alpha\naura_env.manaBarCC[2]={s=true,r=0.03,g=0,b=0.84,a=1} --2+ HS\naura_env.manaBarCC[1]={s=true,r=0.76,g=0.38,b=0.38,a=1} --1 HS\naura_env.manaBarCC[0]={s=true,r=0.38,g=0.38,b=0.38,a=1} --0 HS\n--    linear\n--    FORMAT : Red, Green, Blue, Alpha\naura_env.manaBarCC[\"start\"]={r=0,g=0,b=1,a=1}\naura_env.manaBarCC[\"end\"]={r=1,g=0,b=0,a=1}\n\n--------------------------------------------------------------------\n\n--SIZES AND POSITIONS\naura_env.markerWidth=2\naura_env.manaBarHeight=1/4 --As a fraction of base bar height\naura_env.manaBarPos=\"down\" --\"up\" or \"down\" compared to base bar\n\n----------------------------------------------------------------------------------------------------------------------------------------\n\n--DO NOT CHANGE ANYTHING UNDER THAT!!\n--DO NOT CHANGE ANYTHING UNDER THAT!! PLEASE READ\n--DO NOT CHANGE ANYTHING UNDER THAT!! WTH ARE YOU DOING\n--DO NOT CHANGE ANYTHING UNDER THAT!! I SAID STAHP\n--DO NOT CHANGE ANYTHING UNDER THAT!! Why you still there?\n--DO NOT CHANGE ANYTHING UNDER THAT!!  Better know what you're doing\n\n----------------------------------------------------------------------------------------------------------------------------------------\n\naura_env.this = WeakAuras.regions[aura_env.id].region\naura_env.globWidth = aura_env.this.bar:GetWidth()\naura_env.globHeight= aura_env.this.bar:GetHeight()\naura_env.this:Hide()\naura_env.TMtimer=0\naura_env.powerID=11\naura_env.soundMs=UnitPower('player',aura_env.powerID)\naura_env.markers={}\naura_env.manaPosFactor=(aura_env.manaBarPos==\"up\" and 1) or -1\n--Create Base Bar\naura_env.baseBar=_G[aura_env.id..\"_baseBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_baseBar\",aura_env.this)\naura_env.baseBar:SetWidth(aura_env.globWidth)\naura_env.baseBar:SetHeight(aura_env.globHeight)\naura_env.baseBar:SetMinMaxValues(0,1)\naura_env.baseBar:SetValue(0)\naura_env.baseBar:SetPoint(\"LEFT\",aura_env.this.bar,\"LEFT\")\naura_env.baseBar:SetFrameStrata(\"HIGH\")\naura_env.baseBar:SetStatusBarTexture(aura_env.baseBarT)\naura_env.baseBar:SetStatusBarColor(aura_env.baseBarC.r,aura_env.baseBarC.g,aura_env.baseBarC.b,aura_env.baseBarC.a)\naura_env.baseBar:Show()\n--Create Prediction Bar\naura_env.predictBar=_G[aura_env.id..\"_predictBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_predictBar\",aura_env.this)\naura_env.predictBar:SetWidth(aura_env.globWidth)\naura_env.predictBar:SetHeight(aura_env.globHeight)\naura_env.predictBar:SetMinMaxValues(0,1)\naura_env.predictBar:SetValue(0)\naura_env.predictBar:SetPoint(\"LEFT\",aura_env.this.bar,\"LEFT\")\naura_env.predictBar:SetFrameStrata(\"MEDIUM\")\naura_env.predictBar:SetStatusBarTexture(aura_env.predictBarT)\naura_env.predictBar:SetStatusBarColor(aura_env.predictBarC.r,aura_env.predictBarC.g,aura_env.predictBarC.b,aura_env.predictBarC.a)\naura_env.predictBar:Show()\n--Create ManaBar\naura_env.manaBar=_G[aura_env.id..\"_manaBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_manaBar\",aura_env.this)\naura_env.manaBar:SetWidth(aura_env.globWidth)\naura_env.manaBar:SetHeight(aura_env.manaBarHeight*aura_env.globHeight)\naura_env.manaBar:SetMinMaxValues(0,1)\naura_env.manaBar:SetValue(0)\naura_env.manaBar:SetPoint(\"LEFT\",aura_env.this.bar,\"LEFT\",0,aura_env.manaPosFactor*aura_env.globHeight/2*(1+aura_env.manaBarHeight))\naura_env.manaBar:SetFrameStrata(\"MEDIUM\")\naura_env.manaBar:SetStatusBarTexture(aura_env.manaBarT)\naura_env.manaBar:SetStatusBarColor(aura_env.manaBarC.r,aura_env.manaBarC.g,aura_env.manaBarC.b,aura_env.manaBarC.a)\nif aura_env.showMana then\n    aura_env.manaBar:Show()\nelse\n    aura_env.manaBar:Hide()\nend\n\n--Create MaelstromBar Background Bar\naura_env.bgBar=_G[aura_env.id..\"_bgBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_bgBar\",aura_env.this)\naura_env.bgBar:SetWidth(aura_env.globWidth)\naura_env.bgBar:SetHeight(aura_env.globHeight)\naura_env.bgBar:SetPoint(\"LEFT\",aura_env.this.bar,\"LEFT\")\naura_env.bgBar:SetFrameStrata(\"LOW\")\naura_env.bgBar:SetStatusBarTexture(aura_env.bgBarT)\naura_env.bgBar:SetStatusBarColor(aura_env.bgBarC.r,aura_env.bgBarC.g,aura_env.bgBarC.b,aura_env.bgBarC.a)\naura_env.bgBar:Show()\n\n--Create ManaBar Background Bar\nif aura_env.showMana then\n    aura_env.bg2Bar=_G[aura_env.id..\"_bg2Bar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_bg2Bar\",aura_env.this)\n    aura_env.bg2Bar:SetWidth(aura_env.globWidth)\n    aura_env.bg2Bar:SetHeight(aura_env.globHeight*aura_env.manaBarHeight)\n    aura_env.bg2Bar:SetPoint(\"LEFT\",aura_env.this.bar,\"LEFT\",0,aura_env.manaPosFactor*aura_env.globHeight/2*(1+aura_env.manaBarHeight))\n    aura_env.bg2Bar:SetFrameStrata(\"LOW\")\n    aura_env.bg2Bar:SetStatusBarTexture(aura_env.bgBarT)\n    aura_env.bg2Bar:SetStatusBarColor(aura_env.bgBarC.r,aura_env.bgBarC.g,aura_env.bgBarC.b,aura_env.bgBarC.a)\n    \n    aura_env.bg2Bar:Show()\nelseif aura_env.bg2Bar then aura_env.bg2Bar:Hide()\nend\n\n--Create Cast Texture\nif _G[aura_env.id..\"_castBar\"] then _G[aura_env.id..\"_castBar\"]:Hide() end\nif _G[aura_env.id..\"_castBar2\"] then _G[aura_env.id..\"_castBar2\"]:Hide() end\nif aura_env.showCastBar==\"rectangle\" then\n    aura_env.castBar=_G[aura_env.id..\"_castBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_castBar\",aura_env.this)\n    if aura_env.showMana then\n        aura_env.castBar:SetPoint(\"CENTER\",aura_env.this.bar,\"CENTER\",0,-aura_env.globHeight*aura_env.manaBarHeight/2)\n        aura_env.castBar:SetHeight((aura_env.globHeight)*(1+aura_env.manaBarHeight)+2*aura_env.castBarThickness)\n    else\n        aura_env.castBar:SetPoint(\"CENTER\",aura_env.this.bar,\"CENTER\")\n        aura_env.castBar:SetHeight(aura_env.globHeight+2*aura_env.castBarThickness)\n    end\n    aura_env.castBar:SetWidth(aura_env.globWidth+2*aura_env.castBarThickness)\n    aura_env.castBar:SetMinMaxValues(0,1)\n    aura_env.castBar:SetValue(0)\n    aura_env.castBar:SetFrameStrata(\"BACKGROUND\")\n    aura_env.castBar:SetStatusBarTexture(aura_env.castBarRectT)\n    aura_env.castBar:SetStatusBarColor(aura_env.castBarRectC.r,aura_env.castBarRectC.g,aura_env.castBarRectC.b,aura_env.castBarRectC.a)\n    aura_env.castBar:Show()\n    \nelseif aura_env.showCastBar==\"spark\" then\n    --[[aura_env.castBar=_G[aura_env.id..\"_castBar\"] or CreateFrame(\"StatusBar\",aura_env.id..\"_castBar\",aura_env.this)\n        aura_env.castBar:SetWidth(aura_env.castBarSparkWidth)\n        aura_env.castBar:SetHeight(aura_env.globHeight)\n        aura_env.castBar:SetFrameStrata(\"DIALOG\")\n        aura_env.castBar:SetStatusBarTexture(aura_env.castBarSparkT)\n        aura_env.castBar:SetStatusBarColor(aura_env.castBarSparkC.r,aura_env.castBarSparkC.g,aura_env.castBarSparkC.b,aura_env.castBarSparkC.a)\n        aura_env.castBar:Hide()]]\n    \n    aura_env.castBar2 = _G[aura_env.id..\"_castBar2\"] or CreateFrame(\"Frame\", aura_env.id..\"_castBar2\",aura_env.this.bar);\n    aura_env.castBar2.texture = _G[aura_env.id..\"_castBar2Texture\"] or aura_env.castBar2:CreateTexture(aura_env.id..\"_castBar2Texture\",\"TOOLTIP\",aura_env.castBar2)\n    aura_env.castBar2.texture:SetTexture(aura_env.castBarSparkT)\n    aura_env.castBar2.texture:SetSize(aura_env.castBarSparkWidth,1.8*aura_env.globHeight)\n    aura_env.castBar2.texture:SetVertexColor(aura_env.castBarSparkC.r,aura_env.castBarSparkC.g,aura_env.castBarSparkC.b,aura_env.castBarSparkC.a)\n    aura_env.castBar2.texture:SetBlendMode(\"ADD\")\n    aura_env.castBar2:Hide()\n    aura_env.castBar2.texture:SetPoint(\"CENTER\",aura_env.this.bar,\"LEFT\",0,0)\n    \n    \n    \nend\n\naura_env.createMarker=function(n)\n    aura_env.markers[n]=_G[aura_env.id..\"_marker\"..n] or CreateFrame(\"StatusBar\",aura_env.id..\"_marker\"..n,aura_env.this)\n    aura_env.markers[n]:SetWidth(aura_env.markerWidth)\n    aura_env.markers[n]:SetHeight(aura_env.globHeight)\n    local pos=math.floor(aura_env.globWidth*n/UnitPowerMax('player',aura_env.powerID))+0.4\n    aura_env.markers[n]:SetPoint(\"CENTER\",aura_env.this.bar,\"LEFT\",pos,0)\n    aura_env.markers[n]:SetFrameStrata(\"DIALOG\")\n    aura_env.markers[n]:SetStatusBarTexture(aura_env.markerT)\n    aura_env.markers[n]:SetStatusBarColor(aura_env.markerC.r,aura_env.markerC.g,aura_env.markerC.b,aura_env.markerC.a)\n    if aura_env.showMarkers[n] then\n        aura_env.markers[n]:Show()\n    else \n        aura_env.markers[n]:Hide()\n    end\nend\n\naura_env.getESvalue=function()\n    if aura_env.EStype==\"dynamic\" then\n        local curr,max,start,dur = select(1,GetSpellCharges(GetSpellInfo(51505)))--LvB\n        local gcd, gcdDUR = GetSpellCooldown(61304) -- GCD\n        \n        local LvBoffCD\n        if max and max>1 then\n            LvBoffCD=curr>0\n        else\n            local start,dur=GetSpellCooldown(GetSpellInfo(51505))\n            LvBoffCD = (start==0) or start+dur==gcd+gcdDUR\n        end\n        return ((LvBoffCD and 86) or 92)\n    else\n        return 92\n    end\nend\n\naura_env.moveMarker=function(n,m)\n    if aura_env.markers[n] then\n        local pos=math.floor(aura_env.globWidth*m/UnitPowerMax('player',aura_env.powerID))+0.4\n        aura_env.markers[n]:SetPoint(\"CENTER\",aura_env.this.bar,\"LEFT\",pos,0)\n    end\nend\n\naura_env.TMtickToCastEnd=function()\n    if UnitCastingInfo(\"player\") and aura_env.addTM and aura_env.TMtimer>GetTime() and UnitBuff(\"player\",GetSpellInfo(202188)) then\n        local _,_,_,_,startTime,endTime=UnitCastingInfo(\"player\")\n        endTime=(endTime or 0)/1000\n        local maxEnd=math.min(endTime,aura_env.TMtimer)\n        local TMtick=math.floor(maxEnd-aura_env.lastTick) --Number of Ticks\n        return TMtick\n    else\n        return 0\n    end\nend\naura_env.predictMs=function()\n    local curMs = UnitPower('player',aura_env.powerID)\n    if aura_env.showPrediction then\n        local maxMs = UnitPowerMax('player',aura_env.powerID)\n        local Predict_Ms = 0\n        local SpellCast = UnitCastingInfo('player')\n        \n        if select(1,SpellCast) == GetSpellInfo(188196) and UnitBuff('player',GetSpellInfo(191877))  then --LB & PotM\n            Predict_Ms = 14\n        elseif select(1,SpellCast) == GetSpellInfo(188196) then --LB\n            Predict_Ms = 8\n        elseif select(1,SpellCast) == GetSpellInfo(51505) then --LvB\n            Predict_Ms = 12\n        elseif select(1,SpellCast) == GetSpellInfo(210714) then --IF\n            Predict_Ms = 24\n        elseif select(1,SpellCast) == GetSpellInfo(188443) then --CL\n            Predict_Ms = 6\n        end   \n        local M = curMs+Predict_Ms+aura_env.TMtickToCastEnd() or 0   \n        M=math.max(M,0)\n        M=math.min(M,maxMs)\n        return M\n    else\n        return curMs\n    end\nend\naura_env.updateColorBaseBar=function()\n    if not(aura_env.type==\"false\")then\n        if aura_env.type==\"steps\" then\n            local cap=aura_env.predictMs()\n            if aura_env.baseBarCC[86].s and cap>=aura_env.getESvalue() then cap=86\n            elseif aura_env.baseBarCC[50].s and cap>=50 then cap=50\n            elseif aura_env.baseBarCC[20].s and cap>=20 then cap=20\n            elseif aura_env.baseBarCC[0].s then cap=0\n            else return\n            end\n            --[[ cap=(aura_env.baseBarCC[86].s and math.min(cap,aura_env.getESvalue())) or cap\n            cap=(aura_env.baseBarCC[50].s and math.min(cap,50)) or cap\n            cap=(aura_env.baseBarCC[20].s and math.min(cap,20)) or cap\n            cap=(aura_env.baseBarCC[0].s and math.min(cap,0)) or cap            \n            print(cap)\n            if cap==aura_env.getESvalue() then cap=86 end]]\n            aura_env.baseBar:SetStatusBarColor(aura_env.baseBarCC[cap].r,aura_env.baseBarCC[cap].g,aura_env.baseBarCC[cap].b,aura_env.baseBarCC[cap].a)\n        elseif aura_env.type==\"linear\" then\n            local MsRatio=aura_env.predictMs()/UnitPowerMax('player',aura_env.powerID)\n            local r=aura_env.baseBarCC[\"start\"].r*(1-MsRatio)+aura_env.baseBarCC[\"end\"].r*MsRatio\n            local g=aura_env.baseBarCC[\"start\"].g*(1-MsRatio)+aura_env.baseBarCC[\"end\"].g*MsRatio\n            local b=aura_env.baseBarCC[\"start\"].b*(1-MsRatio)+aura_env.baseBarCC[\"end\"].b*MsRatio\n            local a=aura_env.baseBarCC[\"start\"].a*(1-MsRatio)+aura_env.baseBarCC[\"end\"].a*MsRatio\n            aura_env.baseBar:SetStatusBarColor(r,g,b,a)\n            \n        end\n    end\n    \n    --Change Texture\n    if type(aura_env.barAtCap)==\"number\" or type(tonumber(aura_env.barAtCap))==\"number\" then\n        local num=tonumber(aura_env.barAtCap)\n        local expMs=aura_env.predictMs()\n        if expMs>=num then\n            aura_env.baseBar:SetStatusBarTexture(aura_env.barAtCapBaseT)\n        else\n            aura_env.baseBar:SetStatusBarTexture(aura_env.baseBarT)\n        end\n    elseif aura_env.barAtCap==\"ES\" then\n        local num=aura_env.getESvalue()\n        local expMs=aura_env.predictMs()\n        if expMs>=num then\n            aura_env.baseBar:SetStatusBarTexture(aura_env.barAtCapBaseT)\n        else\n            aura_env.baseBar:SetStatusBarTexture(aura_env.baseBarT)\n        end\n    end\nend\n\naura_env.maxHScast=function()\n    local curr = UnitPower(\"player\",0)\n    local mana_cost = GetSpellPowerCost(8004)[1].cost or 0\n    local base, casting = GetManaRegen()\n    local _,_,_,_,startTime,endTime,_,_,_= UnitCastingInfo(\"player\")\n    local endTime=endTime  or 1000*GetTime()\n    local CastTimeLeft=endTime/1000-GetTime()\n    local ManaRegenerated=CastTimeLeft*casting\n    local ManaAtEnd=ManaRegenerated+curr\n    if curr<mana_cost then\n        return 0\n    elseif  ManaAtEnd<2*mana_cost then\n        return 1\n    else return 2\n    end    \nend\n\naura_env.updateColorPredictBar=function()\n    if not(aura_env.type==\"false\")then\n        if aura_env.type==\"steps\" then\n            local cap=aura_env.predictMs()\n            if aura_env.predictBarCC[86].s and cap>=aura_env.getESvalue() then cap=86\n            elseif aura_env.predictBarCC[50].s and cap>=50 then cap=50\n            elseif aura_env.predictBarCC[20].s and cap>=20 then cap=20\n            elseif aura_env.predictBarCC[0].s then cap=0\n            else return\n            end\n            --[[ cap=(aura_env.baseBarCC[86].s and math.min(cap,aura_env.getESvalue())) or cap\n            cap=(aura_env.baseBarCC[50].s and math.min(cap,50)) or cap\n            cap=(aura_env.baseBarCC[20].s and math.min(cap,20)) or cap\n            cap=(aura_env.baseBarCC[0].s and math.min(cap,0)) or cap            \n            print(cap)\n            if cap==aura_env.getESvalue() then cap=86 end]]\n            aura_env.predictBar:SetStatusBarColor(aura_env.predictBarCC[cap].r,aura_env.predictBarCC[cap].g,aura_env.predictBarCC[cap].b,aura_env.predictBarCC[cap].a)\n        elseif aura_env.type==\"linear\" then\n            local MsRatio=aura_env.predictMs()/UnitPowerMax('player',aura_env.powerID)\n            local r=aura_env.predictBarCC[\"start\"].r*(1-MsRatio)+aura_env.predictBarCC[\"end\"].r*MsRatio\n            local g=aura_env.predictBarCC[\"start\"].g*(1-MsRatio)+aura_env.predictBarCC[\"end\"].g*MsRatio\n            local b=aura_env.predictBarCC[\"start\"].b*(1-MsRatio)+aura_env.predictBarCC[\"end\"].b*MsRatio\n            local a=aura_env.predictBarCC[\"start\"].a*(1-MsRatio)+aura_env.predictBarCC[\"end\"].a*MsRatio\n            aura_env.predictBar:SetStatusBarColor(r,g,b,a)\n            \n        end\n    end\n    if type(aura_env.barAtCap)==\"number\" or type(tonumber(aura_env.barAtCap))==\"number\" then\n        local num=tonumber(aura_env.barAtCap)\n        local expMs=aura_env.predictMs()\n        if expMs>=num then\n            aura_env.predictBar:SetStatusBarTexture(aura_env.barAtCapPredT)\n        else\n            aura_env.predictBar:SetStatusBarTexture(aura_env.predictBarT)\n        end\n    elseif aura_env.barAtCap==\"ES\" then\n        local num=aura_env.getESvalue()\n        local expMs=aura_env.predictMs()\n        if expMs>=num then\n            aura_env.predictBar:SetStatusBarTexture(aura_env.barAtCapPredT)\n        else\n            aura_env.predictBar:SetStatusBarTexture(aura_env.predictBarT)\n        end\n    end\nend\n\naura_env.updateColorManaBar=function()\n    if not(aura_env.type==\"false\")then\n        if aura_env.type==\"steps\" then\n            local cap=aura_env.maxHScast()\n            if aura_env.manaBarCC[2].s and cap>=2 then cap=2\n            elseif aura_env.manaBarCC[1].s and cap>=1 then cap=1\n            elseif aura_env.manaBarCC[0].s and cap>=0 then cap=0\n            else return\n            end\n            --[[ cap=(aura_env.baseBarCC[86].s and math.min(cap,aura_env.getESvalue())) or cap\n            cap=(aura_env.baseBarCC[50].s and math.min(cap,50)) or cap\n            cap=(aura_env.baseBarCC[20].s and math.min(cap,20)) or cap\n            cap=(aura_env.baseBarCC[0].s and math.min(cap,0)) or cap            \n            print(cap)\n            if cap==aura_env.getESvalue() then cap=86 end]]\n            aura_env.manaBar:SetStatusBarColor(aura_env.manaBarCC[cap].r,aura_env.manaBarCC[cap].g,aura_env.manaBarCC[cap].b,aura_env.manaBarCC[cap].a)\n        elseif aura_env.type==\"linear\" then\n            local MnRatio=UnitPower('player',0)/UnitPowerMax('player',0)\n            local r=aura_env.manaBarCC[\"end\"].r*(1-MnRatio)+aura_env.manaBarCC[\"start\"].r*MnRatio\n            local g=aura_env.manaBarCC[\"end\"].g*(1-MnRatio)+aura_env.manaBarCC[\"start\"].g*MnRatio\n            local b=aura_env.manaBarCC[\"end\"].b*(1-MnRatio)+aura_env.manaBarCC[\"start\"].b*MnRatio\n            local a=aura_env.manaBarCC[\"end\"].a*(1-MnRatio)+aura_env.manaBarCC[\"start\"].a*MnRatio\n            aura_env.manaBar:SetStatusBarColor(r,g,b,a)\n            \n        end\n    end\nend\n\naura_env.updateCastBar=function()\n    if not(_G[aura_env.id..\"_castBar\"] and _G[aura_env.id..\"_castBar2\"]) then\n        if aura_env.showCastBar==\"rectangle\" then\n            aura_env.castBar:SetValue(aura_env.getCastFraction())\n        elseif aura_env.showCastBar==\"spark\" then\n            local frac=aura_env.getCastFraction()\n            if frac>0 then\n                if aura_env.castBarSparkAnchor==\"wholeBar\" then\n                    local pos=aura_env.globWidth*frac\n                    aura_env.castBar2: