			["activeTriggerMode"] = -10,
			["sparkRotationMode"] = "AUTO",
			["displayTextLeft"] = " ",
			["animation"] = {
				["start"] = {
					["type"] = "none",
					["duration_type"] = "seconds",
				},
				["main"] = {
					["colorR"] = 1,
					["scalex"] = 1,
					["alphaType"] = "custom",
					["colorA"] = 1,
					["colorG"] = 1,
					["alphaFunc"] = "function(progress, start, delta)\n    if aura_env then\n        \n        -- set region (for ease)\n        local bar = WeakAuras.regions[aura_env.id].region.bar\n        \n        if aura_env.state and aura_env.state.duration then\n            \n            -- get the max time the bar is showing\n            local max = aura_env.state.duration\n            -- get the bar width\n            local maxwidth = WeakAuras.regions[aura_env.id].region.bar:GetWidth()\n            \n            -- get Aimed shot cast time (current and regular (for LnL procs))\n            local AiSDur =  select(4, GetSpellInfo(19434))/1000\n            local AiSmax = 2 / (( GetHaste() / 100 ) + 1)\n            \n            -- see what proportion the cast time is of the bar width\n            local off1 = AiSDur\n            local offset1 = (maxwidth / max) * off1\n            \n            local off2 = off1 + AiSmax\n            local offset2 = (maxwidth / max) * off2\n            \n            local off3 = off2 + AiSmax\n            local offset3 = (maxwidth / max) * off3\n            \n            local off4 = off3 + AiSmax\n            local offset4 = (maxwidth / max) * off4\n            \n            -- set offset 1\n            bar.spark:SetPoint(\n                \"BOTTOM\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"BOTTOM\"..aura_env.point, \n                offset1*aura_env.offsetMulti, \n                0\n            )\n            bar.spark:SetPoint(\n                \"TOP\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"TOP\"..aura_env.point, \n                offset1*aura_env.offsetMulti, \n                0\n            )   \n            if aura_env.state.expirationTime > off1+GetTime()\n            then \n                bar.spark2:Show()\n                aura_env.count = 1\n            else \n                bar.spark2:Hide()\n                aura_env.count = 0\n            end\n            \n            --set offset 2\n            bar.spark2:SetPoint(\n                \"BOTTOM\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"BOTTOM\"..aura_env.point, \n                offset2*aura_env.offsetMulti, \n                0\n            )\n            bar.spark2:SetPoint(\n                \"TOP\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"TOP\"..aura_env.point, \n                offset2*aura_env.offsetMulti, \n                0\n            )   \n            if aura_env.state.expirationTime > off2+GetTime()\n            then \n                bar.spark2:Show()\n                aura_env.count = 2\n            else \n                bar.spark2:Hide()\n            end\n            \n            --set offset 3\n            bar.spark3:SetPoint(\n                \"BOTTOM\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"BOTTOM\"..aura_env.point, \n                offset3*aura_env.offsetMulti, \n                0\n            )\n            bar.spark3:SetPoint(\n                \"TOP\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"TOP\"..aura_env.point, \n                offset3*aura_env.offsetMulti, \n                0\n            )   \n            if aura_env.state.expirationTime > off3+GetTime()\n            then \n                bar.spark3:Show()\n                aura_env.count = 3\n            else \n                bar.spark3:Hide()\n            end\n            \n            --set offset 4\n            bar.spark4:SetPoint(\n                \"BOTTOM\",\n                WeakAuras.regions[aura_env.id].region.bar,\n                \"BOTTOM\"..aura_env.point, \n                offset3*aura_env.offsetMulti, \n                0\n            )\n            bar.spark4:SetPoint(\n                \"TOP\", \n                WeakAuras.regions[aura_env.id].region.bar,\n                \"TOP\"..aura_env.point, \n                offset3*aura_env.offsetMulti, \n                0\n            )   \n            if aura_env.state.expirationTime > off4+GetTime()\n            then \n                bar.spark4:Show()\n                aura_env.count = 4\n            else \n                bar.spark4:Hide()\n            end\n            \n            -- now sort the cast indicator\n            if UnitCastingInfo(\"player\") or WeakAuras.gcdDuration() > 0\n            then\n                local castTime = 0\n                if UnitCastingInfo(\"player\")\n                then \n                    castTime = ( select(6 ,UnitCastingInfo(\"player\")) / 1000) - GetTime() \n                    bar.cast:SetVertexColor(\n                        aura_env.castingColour.r,\n                        aura_env.castingColour.g,\n                        aura_env.castingColour.b,\n                        aura_env.castingColour.a\n                    )\n                    \n                elseif WeakAuras.gcdDuration() > 0\n                then\n                    castTime = select(2, WeakAuras.GetGCDInfo()) - GetTime()\n                    bar.cast:SetVertexColor(\n                        aura_env.GCDColour.r,\n                        aura_env.GCDColour.g,\n                        aura_env.GCDColour.b,\n                        aura_env.GCDColour.a\n                    )\n                end\n                \n                local width = (maxwidth / max) * castTime\n                if width > bar.fg:GetWidth() then width = bar.fg:GetWidth() end\n                \n                bar.cast:SetPoint(\n                    \"BOTTOM\"..aura_env.castPoint, \n                    WeakAuras.regions[aura_env.id].region.bar.fg,\n                    \"BOTTOM\"..aura_env.castPoint, \n                    0*aura_env.offsetMulti, \n                    0\n                )\n                bar.cast:SetPoint(\n                    \"TOP\"..aura_env.castPoint, \n                    WeakAuras.regions[aura_env.id].region.bar.fg,\n                    \"TOP\"..aura_env.castPoint, \n                    0*aura_env.offsetMulti, \n                    0\n                )   \n                bar.cast:SetWidth(width)\n                \n                bar.cast:Show()\n            else\n                bar.cast:Hide()\n            end\n            \n            \n        end\n    end\n    \n    \n    return start\nend",
