etHeight()+1);\nbar.spark3:SetBlendMode(bar.spark:GetBlendMode());\nbar.spark3:SetVertexColor(bar.spark:GetVertexColor())\n\n--create fourth marker\nlocal spark4 = bar:CreateTexture(nil, \"ARTWORK\");\nspark4:SetDrawLayer(\"ARTWORK\", 3);\nbar.spark4 = spark4;\n\nbar.spark4:SetTexture(bar.spark:GetTexture())\nbar.spark4:SetWidth(bar.spark:GetWidth());\nbar.spark4:SetHeight(bar:GetHeight()+1);\nbar.spark4:SetBlendMode(bar.spark:GetBlendMode());\nbar.spark4:SetVertexColor(bar.spark:GetVertexColor())\n\n--create cast section\nlocal cast = bar:CreateTexture(nil, \"ARTWORK\");\ncast:SetDrawLayer(\"ARTWORK\", 3);\nbar.cast = cast;\n\nbar.cast:SetTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Square_White.tga\")\nbar.cast:SetWidth(50);\nbar.cast:SetHeight(bar:GetHeight()+1);\nbar.cast:SetBlendMode(\"ALPHAKEY\");\nbar.cast:SetVertexColor(1,1,1,0.3)",
